import React from 'react';
import {
  Card, Button, CardImg, CardDeck, CardBody
} from 'reactstrap';
import Logo from "../../assets/img/favicon.png";
import { Link } from "react-router-dom";
const Footer = (props) => {
  return (
    <CardDeck>
      <Card>
        <CardBody>
          <Link to="/skills">
            <Button outline color="warning" size="lg" block>Skills</Button>
          </Link><hr/>
          <Link to="/contact">
            <Button outline color="warning" size="lg" block>Contact</Button>
          </Link><hr/>
          <Link to="/howk">
            <Button outline color="warning" size="lg" block>how i work</Button>  
          </Link><hr/>
          <Link to="/project">
            <Button outline color="warning" size="lg" block>project</Button>
          </Link>
        </CardBody>
      </Card>
      <Card>
        <CardBody>
          <CardImg src={Logo} alt="logo" maxWidth="10"/>
          <h3 id="co" className="h1 text-center col-md-6 col-sm-12" >Copyright&copy; 2019 ACE Space&trade; </h3>
        </CardBody>
      </Card>
    </CardDeck>
  );
};

export default Footer;
